async function createAccount(){var e=document.getElementById("signinInputUser").value,n=document.getElementById("signinInputPass").value,t=document.getElementById("signinInputRePass").value;try{var s=await(await fetch("/signin/validateNewAcc",{method:"POST",headers:{Accept:"application/json","Content-Type":"application/json"},body:JSON.stringify({username:e,password:n,confirmPass:t})})).json();"success"===s.message?(document.getElementById("error-text-p").innerText="",document.getElementById("loadingSpinner").style.display="flex",navigateDashBoard(s.user)):document.getElementById("error-text-p").innerText=s.message}catch(e){console.log(e)}}function signin(){document.getElementById("loadingSpinner").style.display="flex",setTimeout(()=>{location.href="/signin"},100)}